import React from "react";
import "./jumbo.css";

const Jumbo = () => (

    <div className="jumbotron jumbotron-fluid clouds text-center">
        <h1 className="display-4">DragonBall Z Click</h1>
        <p className="lead">Click on a DBZ character to earn points, but don't click on any more than once!</p>
    </div>

);

export default Jumbo;
